import React, { useState } from 'react';

export default function Admin() {
  const [matchDate, setMatchDate] = useState('');
  const [teamBlue, setTeamBlue] = useState([
    { nickname: '', champion: '', result: '승', k: 0, d: 0, a: 0, perfect: false }
  ]);

  const handleChange = (teamSetter, team, index, field, value) => {
    const updated = [...team];
    updated[index][field] = value;
    teamSetter(updated);
  };

  const addPlayer = (teamSetter, team) => {
    teamSetter([
      ...team,
      { nickname: '', champion: '', result: '승', k: 0, d: 0, a: 0, perfect: false }
    ]);
  };

  return (
    <div className="max-w-5xl mx-auto p-6">
      <h2 className="text-xl font-bold mb-4">⚔ 전적 입력 (관리자 전용)</h2>

      <label className="font-semibold block mb-2">날짜: 연도-월-일</label>
      <input
        type="date"
        className="border rounded px-3 py-2 mb-6"
        value={matchDate}
        onChange={(e) => setMatchDate(e.target.value)}
      />

      {/* 블루팀 입력 */}
      <h3 className="text-lg font-semibold text-blue-700 mb-2">🔵 블루팀</h3>

      {/* 헤더 라벨 */}
      <div className="grid grid-cols-[120px_100px_80px_60px_60px_60px_80px] font-bold text-sm mb-2">
        <div>소환사명</div>
        <div>챔피언</div>
        <div>결과</div>
        <div>Kills</div>
        <div>Deaths</div>
        <div>Assists</div>
        <div>Perfect</div>
      </div>

      {teamBlue.map((player, idx) => (
        <div
          key={idx}
          className="grid grid-cols-[120px_100px_80px_60px_60px_60px_80px] gap-2 mb-2 items-center"
        >
          <input
            type="text"
            className="w-full border rounded px-2 py-1"
            value={player.nickname}
            onChange={(e) => handleChange(setTeamBlue, teamBlue, idx, 'nickname', e.target.value)}
          />
          <input
            type="text"
            className="w-full border rounded px-2 py-1"
            value={player.champion}
            onChange={(e) => handleChange(setTeamBlue, teamBlue, idx, 'champion', e.target.value)}
          />
          <select
            className="w-full border rounded px-2 py-1"
            value={player.result}
            onChange={(e) => handleChange(setTeamBlue, teamBlue, idx, 'result', e.target.value)}
          >
            <option value="승">승</option>
            <option value="패">패</option>
          </select>
          <input
            type="number"
            className="w-full border rounded px-2 py-1"
            value={player.k}
            onChange={(e) => handleChange(setTeamBlue, teamBlue, idx, 'k', Number(e.target.value))}
          />
          <input
            type="number"
            className="w-full border rounded px-2 py-1"
            value={player.d}
            onChange={(e) => handleChange(setTeamBlue, teamBlue, idx, 'd', Number(e.target.value))}
          />
          <input
            type="number"
            className="w-full border rounded px-2 py-1"
            value={player.a}
            onChange={(e) => handleChange(setTeamBlue, teamBlue, idx, 'a', Number(e.target.value))}
          />
          <label className="flex items-center gap-1">
            <input
              type="checkbox"
              checked={player.perfect}
              onChange={(e) => handleChange(setTeamBlue, teamBlue, idx, 'perfect', e.target.checked)}
            />
            퍼펙트
          </label>
        </div>
      ))}

      <button
        onClick={() => addPlayer(setTeamBlue, teamBlue)}
        className="mt-2 text-blue-700 hover:underline"
      >
        + 블루 추가
      </button>
    </div>
  );
}
